description:
This DVD features From Here On and their first tour from Southern Illinois to Florida and back. For more information and other original media, check out www.soillgang.com, www.soillrecords.com, andRadio Off is the new band comprised of most of the original members of From Here On. In addition the .jpg files should be ready to print in the event that you would like to make DVD inserts.

Thanks,
Captain C-bag

